import React from "react";

function Nav() {
  return (
    <div className="nav">
      <img
        className="nav__logo"
        src="https://pmcvariety.files.wordpress.com/2020/05/netflix-logo.png"
        alt="Netflix Logo"
      />
      <img
        className="nav__logo"
        src="https://i.pinimg.com/originals/0d/dc/ca/0ddccae723d85a703b798a5e682c23c1.png"
        alt="Netflix Logo"
      />
    </div>
  );
}

export default Nav;
